import {useState} from 'react'

function Signup(){
    const [name, SetName] = useState('');
    const [email, SetEmail] = useState('');
    const [role, SetRole] = useState('');
    const [password, SetPassword] = useState('');

    const handleChangesubmit =(e)=>{
        <e className="prevent default"></e>
    }

    return(
        <div>
            <form onSubmit={handleChangesubmit}>
                <label>
                    Name:
                    <input type='text'value={name} onChange={e => SetName(name)} placeholder='Enter your name'></input>
                </label>
                <br></br>
                <label>
                    Email:
                    <input type='text'value={email} onChange={e => SetEmail(email)} placeholder='Enter your Email'></input>
                </label>
                <label>
                    Role:
                    <input type='text'value={role} onChange={e=> SetRole(role)} placeholder='Enter your role'></input>
                </label>
                <label>
                    Password:
                    <input type='text'value={password} onChange={e=>SetPassword(password)} placeholder='Enter your password'></input>
                </label>
                <br /><br />
                <button type='submit'>CreateUser</button>
            </form>
        </div>
    )
}
export default Signup;
